import {View, Text} from 'react-native';
import React from 'react';
import {connect} from 'react-redux';
import {StoreState} from '../../models/reduxModel';
import Modal from 'react-native-modal';
import QRCode from 'react-native-qrcode-svg';
import {TouchableOpacity} from 'react-native-gesture-handler';
import QubeButton from '../QubeButton';
import {QrSetAction} from '../../Store/actions/storeAction';
import ThermalPrinterModule from 'react-native-thermal-printer';
let ThermalPrinterEncoder = require('thermal-printer-encoder');
const QRCodeGenerator = ({qr_flag, qr, QrSetAction}: any) => {
  const Print = () => {
    ThermalPrinterModule.printBluetooth({
      printerWidthMM: 45,
      mmFeedPaper: 45,
      payload: `[C]<barcode type='128' height='10'>${
        qr?.split('-')[qr?.split('-').length - 1]
      }</barcode>\n`,
    })
      .then(res => {})
      .catch(err => {});
  };
  return (
    <Modal
      style={{width: '50%', position: 'absolute', left: '22%', top: '20%'}}
      testID={'modal'}
      onBackdropPress={() => QrSetAction({qr: '', qr_flag: false})}
      isVisible={qr_flag}>
      <View
        style={{
          backgroundColor: '#ffff',
          padding: 20,
          justifyContent: 'center',
          alignItems: 'center',
          borderRadius: 10,
        }}>
        {!!qr && (
          <QRCode
            value={qr}
            logo={{
              uri: `data:image/jpeg;base64,`,
            }}
            logoSize={50}
            size={250}
            logoBackgroundColor="transparent"
          />
        )}
        <View style={{marginTop: 20}}>
          <Text> QR Code : {qr}</Text>
        </View>
        <View
          style={{
            padding: 20,
            flexDirection: 'row',
            width: '100%',
            justifyContent: 'space-around',
          }}>
          <View style={{width: '45%'}}>
            <QubeButton onPress={() => Print()} title="Print" />
          </View>
          <View style={{width: '45%'}}>
            <QubeButton title="Download" />
          </View>
        </View>
      </View>
    </Modal>
  );
};

const mapStateToProps = (state: StoreState, ownProps: any) => {
  return {
    qr: state.store.qr,
    qr_flag: state.store.qr_flag,
  };
};
const mapDispatchToProps = {
  QrSetAction,
};

export default connect(mapStateToProps, mapDispatchToProps)(QRCodeGenerator);
